import React from 'react';

class Cookies extends React.Component{
  render(){
    return(
      <div id="middle" className="column effect-hover"><a href="#Cookiesbar">
      <div className="content">
        {/* <i className="fa fa-venus" aria-hidden="true"></i> */}
        <h2>Samar's<span>Cookies</span></h2>
        <h3>A taste from another galaxy</h3>
        <p className="msgcake">Try our cookies</p>
      </div>		    
      </a>
    </div>
    )
  }
}

export default Cookies;
